위의 언급한 '바인딩되지 않는 this 문제' 를 bind 함수 이외에 다른 방법으로 해결할 수 있습니다. 바로 화살표 함수Arrow function expression와 React 함수형 컴포넌트를 사용하는 것입니다.
먼저 화살표 함수를 사용하면 bind 함수 대신 아래와 같이 변경할 수 있습니다.
